Human Resource and Guidance Counselor In-charge (June 6, 2018 – March 31, 2019)
Siena College Tigaon (Tigaon, Camarines Sur-)
Duties and Responsibilities of an HR
1. Observes and implements established office policies and procedures;
2. Encodes memoranda / responses to office correspondences;
3. Attends to office inquiries;
4. Maintains an effective filing system of correspondences, records, reports, etc.;
5. Performs standard office procedures which include scheduling of appointments, ordering and maintaining supplies inventory, answering phone calls, sorting and dispatching incoming / outgoing mail;
6. Assists in the preparation of monthly reports and other documentation activities; and
7. Performs other related tasks that may be assigned from time to time.
Duties and Responsibilities of a Guidance Counselor
Prepares the Guidance Program for Basic Education Department and for the Service Education Department for each school year;
Renders counseling services to students;
Participates in career talks sponsored by other schools in line with the Recruitment Program;
Administers tests and prepares written psychological/assessment reports;
Prepares assessment reports based on students' counseling sessions; and
Performs other related tasks that may be assigned from time to time.
